import React from "react";
import { Link } from "react-router-dom";

function MenuItem({ image, name, }) {
  return (
    <div className="menuItem"> 
    <link to="/home">
      <div style={{ backgroundImage: `url(${image})` }}> </div>
      <h1> {name} </h1>
      </link>
    </div>
  );
}

export default MenuItem;
